import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { Alert, Button, StyleSheet, Text, View, FlatList } from 'react-native';

const Separator = ({ styles }) => (
    <View style={styles.separator} />
);

const items = [
    { key: "Item 1" },
    { key: "Item 2" },
    { key: "Item 3" },
    { key: "Item 4" },
    { key: "Item 5" }
];

export default function CustomerMenu({ styles, navigation, state }) {
    return (
        <View style={styles.container}>
            <View>
                <Text style={styles.title}>Catalog</Text>
                <FlatList
                    data={items}
                    renderItem={({ item }) => {
                        return <itemRow item={item} styles={styles} state={state} />
                    }}
                />
            </View>
        </View>
    );
}

const itemRow = (item, styles, state) => {
    return (
        <View>
            <Text style={styles.item}>{item.key}</Text>
        </View>
    );
}
